            WriteLiteral(@">


            <p>
                <strong>Nöroloji</strong><br>
            </p>

            <p>
                <br>
                Nöroloji polikliniğimiz; tüm beyin ve sinir sistemi hastalıklarında tanı ve tedavi amaçlı olarak poliklinik, acil servis ve yataklı servisleri ile hizmet vermektedir. Tanı ve kısa süreli tedavi hizmetleri yanı sıra multidisipliner bir anlayışla kronik nörolojik hastalıkların uzun süreli tedavi ve takibi de hastanemizce gerçekleştirilmektedir<br>
                <br>
                <strong>Nöroloji bölümümüzün hizmet alanına giren hastalıklar;</strong>
            </p>

            <ul>
                <li>Baş-yüz ağrısı sendromları ve migren</li>
                <li>Baş dönmesi ve denge bozukluğu sendromları</li>
                <li>Bilinç kaybı (bayılma) atakları ve epilepsi</li>
                <li>Beyin damar hastalıkları</li>
                <li>Alzheimer hastalığı ve diğer demans (bunama) sendromları</li>
                <li>Parkinson hastalığı ve d");
