                <li>Multipl Skleroz ve diğer demiyelinizan hastalıklar</li>
                <li>Kas hastalıkları</li>
            </ul>

            <p><strong>Bölümümüzdeki bazı uygulamalar;&nbsp;</strong></p>

            <ul>
                <li>Manyetik Rezonans (MR)</li>
                <li>Bilgisayarlı Tomografi (BT)</li>
                <li>Elektrosensefalografi (EEG)</li>
